script: |
  super -f text -I q3095.spq | sort > q3095.out

inputs:
  - name: q3095.spq
    data: |
      SELECT - - col0, + CAST ( - - 40 AS INTEGER ) FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN - col1 * - col0 AND col1 / + - col2;
  - name: tab2

outputs:
  - name: q3095.out
    data: |
